import styled from "styled-components";

export const Container = styled.div`
  width: 48%;
  height: 22%;
  margin-bottom: 1rem;
  display: flex;
  justify-content: flex-start;

  &:hover {
    cursor: default;
  }
`;

export const UserWrap = styled.div`
  height: 63%;
`;
